import React from 'react';
import { Row, Col } from 'react-bootstrap'

const Footer = () => {
    return (
        <Row>
            <Col>
                <div className="text-center">
                    <p style="fontSize: 1.063rem">Developed by Dongwook Kim (dongwook224@naver.com)</p>
                </div>
            </Col>
        </Row>
    )
}

export default Footer;
